INSERT INTO `cms` (`id`, `title`, `content`) VALUES
(1, 'About Action Investor Network', '<p>Action Investor Network is an innovative online portal for real estate investors in both residential and commercial sectors. Action Investor Network connects financial investors seeking properties to fund with investors that have properties that needs funding.</p>\r\n<p>From the initial start of the website, Action Investor Network\'s primary goal was to provide real estate investors with pertinent information for knowledgeable investment. Unlike other investment portals, only real estate investments are listed. Additionally, all of the property postings are actual real estate deals that other investors, such as yourself, find on a regular basis. These investments provide a great opportunity for rehabbing, flipping, and equity partnerships.</p>\r\n<p>Action Investor Network is committed to providing real estate investors with crucial investment details and an opportunity for growth into other sectors with minimal risk...</p>'),
(2, 'Privacy Policy', '<p>Action Investor Network provides a variety of online services for both residential and commercial real estate investors. Any user information we collect is considered private and we do not use it or share it except as permitted herein, without the user\'s permission. We use this personal information to provide the best quality service possible. The following policy statement summarizes Action Investor Network and its affiliated sites, including, but not limited to, CREInvestorHub.com, CREInvestorNetwork.com, CREInvestorweb.com, CRE-Investor.com, APT-Investor.com, MultiFamily-Investor.com, protection and use of any personal information provided by visitors to the site. </p>\r\n<p><strong>Registration:</strong><br />\r\nThe Personal Information you provide when you become a registered user or customer of one of the Sites is used primarily to help us customize your online experience, increase the convenience of accessing new tools, products and services, and, if applicable, provide the products and/or services you purchase or request. </p>\r\n<p>Your email address serves as a unique identifier in our record system, and together with your password is designed to prevent unauthorized access to any information you choose to store on the Sites. If you forget your password for any registered area of the Sites, we have an automated password recovery system, which can be accessed by clicking on the &quot;Forgot Password?&quot; link on the sign-in page. </p>\r\n<p><strong>Cookies</strong><strong>:</strong><br />\r\nCookies are small text files that we send to and store on your computer so that we can recognize it as a unique machine the next time you visit the Sites. You are always free to decline any cookies we use if your browser permits. Some of our advertisers and third-party service providers may also utilize their own cookies. In addition, we and our service providers sometimes use &quot;clear GIFs&quot; in connection with cookies and other website functions. Clear GIFs perform administrative functions without detracting from your online experience. They may be used to perform statistical and administrative tasks including measuring site and page traffic, verifying advertising avenues and positioning images on the web. Clear GIFs do not collect Personal Information. </p>\r\n<p><strong>Information Security:</strong><br />\r\nWhenever Personal Information about you is stored on our computers, that information is password-protected from unauthorized access or use. </p>\r\n<p>In addition, this information is kept on servers that are located behind a firewall. Since your financial information and other Personal Information is especially sensitive, we take special care to keep it secure. All information and forms asking for personal information is transmitted over secure Internet connections using SSL (Secure Sockets Layer) encryption. </p>\r\n<p>In addition , to the extent that we may ask for your credit card number or financial information, these will be stored on servers where data access is limited to individuals in departments charged with using such information only in connection with processing your orders for products and services purchased. However, orders processed by our partners, marketing partners and service providers that provide the service or product requested may store such information on their servers which are governed by such third party&rsquo;s privacy policy and security procedures. </p>\r\n<p>Unfortunately no data transmission over the Internet or the storage of information on servers can be guaranteed to be 100% secure and while we strive to protect your personal information, in-line with industry standards, we cannot guarantee or warrant its complete security. </p>\r\n<p><strong>Links to other sites:<br />\r\n</strong>Action Investor Network is not responsible for the privacy practices or the content of such Web sites. For more detailed information regarding their privacy policy, please visit their respective sites. </p>\r\n<p>Be aware that our Sites link to other Web sites that may collect personally identifiable information about you. This Privacy Policy only applies to the Sites, and we are not responsible for the privacy practices or the content for any linked Web sites. You should refer to the privacy policies and statements of other Web sites or contact the respective Webmasters of those Web sites to obtain information regarding their information collection, use and disclosure policies. </p>\r\n<p><strong>Use of Information Collected:<br />\r\n</strong>Collected information helps us better understand its users\' needs in order to improve its product and service offerings. Email addresses are used to communicate with members through Promotional emails, Partner emails and for site administration purposes.</p>\r\n<p>Unless you specify that you\'d prefer not to hear from us, we may use the email address you provide at the time of registration to contact you for promotional or other purposes. You may have these communications terminated at any time by opting out by clicking on any &ldquo;unsubscribe&rdquo; link contained in a promotional email. If you would like to request to opt out, please email <a target=\"_blank\" href=\"mailto:unsubscribe@ActionInvestorNetwork.com?Subject=Unsubscribe\">unsubscribe@ActionInvestorNetwo<wbr></wbr>rk.com</a> with your request. </p>\r\n<p>User search activity is collected and analyzed and may be utilized in the aggregate or in the abstract for a variety of business purposes. Financial information is used to bill users for products and services purchased. This information is encrypted and not shared with anyone outside of Action Investor Network. IP address and cookie log data is analyzed to better understand traffic flows and user preferences.</p>\r\n<p><strong>Legal Rights:</strong><br />\r\nWe will release Personal Information if we believe that such action is appropriate to: (1) comply with legal process, (2) enforce the Terms of Use Agreement for the applicable Site, or (3) identify, contact or bring legal action against persons or entities who are or we believe will cause injury to us or a third party, or (4) otherwise protect the rights, property or personal safety of Action Investor Network, its employees, Site users or others. </p>\r\n<p><strong>Correction/Update:<br />\r\n</strong>You may edit your information by returning to the area of the Site where you registered and modifying the information there, by calling us at (562) 427-3714, or by emailing us at <a target=\"_blank\" href=\"mailto:support@ActionInvestorNetwork.com?subject=Update%20User%20Information%20Request\">support@ActionInvestorNetwork<wbr></wbr>.com</a>. By contacting us to make such changes, you expressly authorize Action Investor Network to access your data for the purposes of completing your requested edits, modifications and/or deletions. </p>\r\n<p><strong>Effective Date:</strong><br />\r\nThis Privacy Policy is effective as of the date first written above and may be updated and modified from time to time by us in our sole discretion. If we choose to update or modify this Privacy Policy, such updated or modified policy shall become effective five (5) business days after its posting on the applicable Site(s). Accordingly, we encourage you to periodically review this Privacy Policy and the Sites in order to keep apprised of our current privacy practices. If you do not agree to any provision of this Privacy Policy, or any update or modification thereto, please do not use the Sites. </p>\r\n<p><strong>Contacting the Web Site:<br />\r\n</strong>If you have any questions about this privacy statement, the practices of this site, or your dealings with this Web site, you can contact us at: </p>\r\n<p>Action Investor Network, Inc.<br />\r\n<a target=\"_blank\" href=\"mailto:support@ActionInvestorNetwork.com?Subject=Privacy\">support@ActionInvestorNetwork<wbr></wbr>.com</a><br />\r\nPH: (562) 427-3714<br />\r\n<br />\r\n</p>'),
(4, 'Banner & Text Links - Link to Action Investor Network', '<p>We have created 7 images that you can place on your website to link directly to Action Investor Network. These images can be downloaded to your server or used directly from our image server.</p>\r\n<p>468X69</p>\r\n<p><img height=\"60\" alt=\"\" width=\"468\" src=\"http://www.actioninvestornetwork.com/banners/468-69-Border.jpg\" /><br />\r\n&nbsp;<br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/468-69-Border.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt;</p>\r\n<p>468X69<br />\r\n<img height=\"60\" alt=\"\" width=\"468\" src=\"http://www.actioninvestornetwork.com/banners/468-69-NoBorder.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/468-69-NoBorder.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>234X60<br />\r\n<img height=\"60\" alt=\"\" width=\"234\" src=\"http://www.actioninvestornetwork.com/banners/234-60-Border.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/234-60-Border.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>234X60<br />\r\n<img height=\"60\" alt=\"\" width=\"234\" src=\"http://www.actioninvestornetwork.com/banners/234-60-NoBorder.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/234-60-NoBorder.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>200X200<br />\r\n<img height=\"200\" alt=\"\" width=\"200\" src=\"http://www.actioninvestornetwork.com/banners/200-200-Border.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/200-200-Border.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>200X200<br />\r\n<img height=\"200\" alt=\"\" width=\"200\" src=\"http://www.actioninvestornetwork.com/banners/200-200-NoBorder.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/200-200-NoBorder.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>180X150<br />\r\n<img height=\"150\" alt=\"\" width=\"180\" src=\"http://www.actioninvestornetwork.com/banners/180-150-NoBorder.jpg\" /><br />\r\n&lt;a href=&quot;http://www.ActionInvestorNetwork.com&quot; target=&quot;blank&quot;&gt;<br />\r\n&lt;img src=&quot;http://www.ActionInvestorNetwork.com/banners/180-150-NoBorder.jpg&quot; alt=&quot;Action Investor Network&quot; &gt;<br />\r\n&lt;/a&gt; </p>\r\n<p>&nbsp;</p>\r\n<h5>Text Banner Links</h5>\r\n<p>Below are Preferred Text Link to Action Investor Network. We would appreciate it if you can use these links exactly as they are stated.</p>'),
(5, 'FAQ', '<p>General Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#GQ1\">What does Action Investor Network do?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#GQ2\">How does it work?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#GQ3\">How do I contact other members?</a></li>\r\n</ul>\r\n<p>Education Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#EDU1\">Where can I find information on Real Estate investing?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#EDU2\">What is the difference between Residential and Commercial properties?</a></li>\r\n</ul>\r\n<p>Membership Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#MEM1\">What are the requirements for becoming a member?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#MEM2\">What is the benefits of being a member?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#MEM3\">How much does it cost to be a registered member? </a></li>\r\n</ul>\r\n<p>Account Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ACCT1\">How do I log into my account?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ACCT2\">How can I reset my password?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ACCT3\">How do I close my account?</a></li>\r\n</ul>\r\n<p>Property Posting Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#POST1\">How much does it cost to post properties?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#POST2\">When does the Posting appear on the website?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#POST3\">How do I edit an existing posting?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#POST4\">How do I delete a posting?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#POST5\">Who will see my property postings?</a></li>\r\n</ul>\r\n<p>Deal Analysis Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ANA1\">What is Deal Analysis?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ANA2\">Who Analyzes the deals?</a></li>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#ANA3\">What does Deal Analysis cost? </a></li>\r\n</ul>\r\n<p>Misc. Questions:</p>\r\n<ul>\r\n    <li><a href=\"http://www.actioninvestornetwork.com/faq.php#MISC1\">How do I advertise on your website?</a></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>Answers to FAQ </h3>\r\n<p><a name=\"GQ1\"></a>What does Action Investor Network do?<br />\r\nAction Investor Network is an exclusive online source for investors in both residential and commercial real estate to find suitable investments that meet their individual criteria. </p>\r\n<p><a name=\"GQ2\"></a>How does it work?<br />\r\nAction Investor Network allows a finder/property investor to post specific properties which will be viewable to financial investors looking for investment vehicles. </p>\r\n<p><a name=\"GQ3\"></a>How do I contact other members?<br />\r\nTo view the member\'s profile, you must be registered member of the website with a subscription. Once you are a member, the posting member\'s profile will be viewable towards the bottom of he property posting. To contact this poster, click on the email link. This will allow you to email the poster for additional information. </p>\r\n<p><a name=\"EDU1\"></a>Where can I find information on Real Estate investing?<br />\r\nThere are numerous informational books and websites available that will explain the fundamentals of real estate investing. Action Investor Network currently has a BLOG site which explains basic fundamentals. The BLOG can be viewed at: <a target=\"New\" href=\"http://actioninvestornetwork.blogspot.com/\">http://ActionInvestorNetwork.blogspot.com</a>.</p>\r\n<p><a name=\"EDU2\"></a>What is the difference between Residential and Commercial properties?<br />\r\nResidential properties are any property that is considered to be as follows: Single Family, Condominium, Townhouse, Planned Unit Development, 2 Units, 3 Units, 4 Units, Mobile homes, Manufactured homes, and vacant land that is suitable for residential development.. Any properties with 5 or more units, and buildings where commercial operation is the primary goal, and development are considered to be commercial properties. More detailed information can be viewed on our BLOG site at: <a target=\"New\" href=\"http://actioninvestornetwork.blogspot.com/\">http://ActionInvestorNetwork.blogspot.com</a>.</p>\r\n<p><a name=\"MEM1\"></a>What are the requirements for becoming a registered member?<br />\r\nThere are no specific requirements in terms of licenses, whether business or legal, to be a member of Action Investor Network. However, this site, being a paid membership site, requires a valid credit card to join. Anyone age 18 and over can be a member at anytime by click on this <a href=\"http://www.actioninvestornetwork.com/register.php\">link</a>. </p>\r\n<p><a name=\"MEM2\"></a>What are the benefits of being a registered member?<br />\r\nAs a registered member of Action Investor Network, you can view complete property posting details, contact the poster for additional information, and receive weekly emails of new property postings. New features are added occasionally and will be available to registered members only. To become a registered member, please click on this <a href=\"http://www.actioninvestornetwork.com/register.php\">link</a>. </p>\r\n<p><a name=\"MEM3\"></a>How much does it cost to be registered member?<br />\r\nAction Investor Network is currently in Beta Phase. Therfore, no fees are charged for registering as a member. However, Action Investor Network reserves the right to charge membership fees at any time with a 1 month notice to our existing members. At that time, membership fee is estimated to be $20.00 per month without any long term commitments. To join Action Investor Network, please click on this <a href=\"http://www.actioninvestornetwork.com/register.php\">link</a>. </p>\r\n<p><a name=\"ACCT1\"></a>How do I log into my account?<br />\r\nTo Log in, please visit the <a href=\"http://www.actioninvestornetwork.com/index.php\">homepage</a> and input your username (your email address), and password in the form fields on the top right of the page. Please note that the password is case sensitive while the username is not. </p>\r\n<p><a name=\"ACCT2\"></a>How can I reset my password?<br />\r\nNavigate to <a href=\"http://www.actioninvestornetwork.com/myaccount.php\">My Accounts</a> page and click on Change Password. Type in your current password and your new password and click on Change Password button on the bottom. </p>\r\n<p><a name=\"ACCT3\"></a>How do I close my account?<br />\r\nAccount can be closed by emailing us at <a href=\"mailto:billing@ActionInvestorNetwork.com?Subject=Account%20Cancellation\">billing@ActionInvestorNetwork.com</a>. At the same time, please provide a reason why you are closing your account. We take all feedbacks seriously and use it to add new features and benefits to the members. </p>\r\n<p><a name=\"POST1\"></a>How much does it cost to post properties?<br />\r\nAs long as you remain a registered member of Action Investor Network, all property postings are FREE. However, Action Investor Network, Inc. reserves the right to change or modify the posting fee at any time with 1 month notice.</p>\r\n<p><a id=\"POST2\" name=\"POST2\"></a>When does the Posting appear on the website? <br />\r\nAll property postings will be reviewed by Action Investor Network\'s staff for accuracy and completeness. This insures the registered members that all crucial information is present to make a sound decision. This process takes less than 1 hour from time of posting but can vary depending on the amount of postings. Therefore, please allow up to 24 hours for your posting to appear on the website. </p>\r\n<p><a id=\"POST3\" name=\"POST3\"></a>How do I edit an existing posting?<br />\r\nNavigate to <a href=\"http://www.actioninvestornetwork.com/myaccount.php\">My Accounts</a> page and click on Edit link that corresponds to the property you would like to edit. Make changes to the property posting. When finished, click on Save button on the bottom to save the new changes.</p>\r\n<p><a id=\"POST4\" name=\"POST4\"></a>How do I delete a posting?<br />\r\nNavigate to <a href=\"http://www.actioninvestornetwork.com/myaccount.php\">My Accounts</a> page and click on Delete link that corresponds to the property you would like to delete. Once a property posting has been deleted, you will be asked if it has been funded. Your answer, while not required, will be appreciated. </p>\r\n<p><a id=\"POST5\" name=\"POST5\"></a>Who will see my property postings?<br />\r\nAll properties posted will be viewable by all visitors. However, non-members will be shown an abbreviated listing. The abbreviated listing will not show contact information, financial information, file attachments, and other pertinent information. Registered members of Action Investor Network will be able to view all posting information except the property address and will be allowed to contact the poster through email for additional information. </p>\r\n<p><a name=\"ANA1\"></a>What is Deal Analysis?<br />\r\nDeal Analysis is a service offered by Action Investor Network that enables a star rating (2-5 stars) for a posted deal. The star rating is based on profitability of the deal and are shown first for all searches in a descending order of stars.</p>\r\n<p><a name=\"ANA2\"></a>Who analyzes the deals?<br />\r\nEach deals that are posted with a star rating are reviewed and analyzed by Action Investor Network\'s staff. Our staff is knowledgeable in both commercial and residential real estate investments. Each deal is analyzed using a system that measures the potential profitability. </p>\r\n<p><a name=\"ANA3\"></a>What does Deal Analysis cost?<br />\r\nCost for Deal Analysis is $49. This is a one time charge for a specific property and includes all reviews and rating that pertains to that property. </p>\r\n<p><a id=\"MISC1\" name=\"MISC1\"></a>How do I advertise on your website?<br />\r\nFor advertising opportunities, please send us an <a href=\"mailto:advertise@ActionInvestorNetwork.com?Subject=Advertising\">email</a> with your inquiry. </p>'),
(6, 'Contact Us', '<p>Corporate Mailing Address <br />\r\n1752 Grand Ave.&nbsp; #9<br />\r\nLong Beach, CA. 90804<br />\r\nPH: (562) 427-3714 </p>\r\n<p>Having trouble using with our site? </p>\r\n<ul>\r\n    <li><a target=\"_blank\" href=\"faq.php\">View our Frequently Asked Questions (FAQ)</a> </li>\r\n    <li><a target=\"_blank\" href=\"mailto:support@ActionInvestorNetwork.com?subject=Support\">Email our member support staff for additional help</a> </li>\r\n</ul>\r\n<p>Would you like to advertise with us?</p>\r\n<ul>\r\n    <li><a href=\"mailto:support@actioninvestornetwork.com?subject=Advertising%20Inquiry\">Send us an email with your inquiry </a></li>\r\n</ul>'),
(9, 'Jobs', '<table width=\"100%\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>Action Investor Network provides an energetic individual an opportunity to thrive without being micro managed. We are located in Long Beach, California, a few minutes from the Pacific Ocean.\r\n            <p>Current Positions:</p>\r\n            <ul>\r\n                <li>No opportunities are available at this time. Please check back later or email us your resume to <a href=\"mailto:support@ActionInvestorNetwork.com?subject=Job%20Opportunity\">support@ActionInvestorNetwork.com</a> and we will contact you when an opportunity that matches your qualification comes up. </li>\r\n            </ul>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>'),
(7, 'Home', '<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"tablecontent1\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding-right: 15px; padding-left: 15px; padding-top: 15px;\" class=\"tablecontent1\"><span class=\"center_heading1\"><strong>For Wholesale Real Estate Investors and Financial  Investors &amp; Partners....</strong></span> <br />\r\n            <br />\r\n            Wholesale Property Investors use  Action Investor Network (BETA) as a primary source for finding Real Estate  Investment Properties and other Real Estate Investor Partners. This website is an ideal  portal for Wholesale Real Estate Investors and Financial Investors &amp;  Partners to come together.<br />\r\n            <br />\r\n            <strong>Wholesale Real Estate Property Investors:</strong>  <br />\r\n            <br />\r\n            Post your Wholesale Investment Property and Investment Deals FREE after  Registration. All posted properties are viewable by all registered members. All  interested parties that will like to invest in that deal will be able to contact  you through email.<br />\r\n            <br />\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"center\" class=\"center_heading2\"><strong>*All Real Estate Investment postings  will be reivewed for accuracy<br />\r\n            and completeness by the Action Investor Network  staff*</strong><br />\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td bgcolor=\"#ffffff\" style=\"padding-right: 15px; padding-left: 15px; padding-top: 15px;\" class=\"tablecontent1\"><strong>Real Estate Financial Investors &amp;  Partners:</strong><br />\r\n            <br />\r\n            Browse through all Wholesale Investment Property postings  based on whether you prefer Residential or Commercial properties. Once you find  a Wholesale Investment Property that intersts you, click on the link and view the details  about that particular deal.<br />\r\n            <br />\r\n            Thank you for your support and we look  forward to helping you succeed in Real Estate Investing.<br />\r\n            <br />\r\n            TIP: Please  submit as much information as possible in your postings. All of our member  investors appreciate details and it has been known to generate more interest as  it reflects on the quality of your posting..</td>\r\n        </tr>\r\n<tr><td align=\"center\"><br /><br />\r\n<script type=\"text/javascript\"><!--\r\ngoogle_ad_client = \"pub-7760813711277063\";\r\n/* 468x15, created 10/10/11 */\r\ngoogle_ad_slot = \"0769853927\";\r\ngoogle_ad_width = 468;\r\ngoogle_ad_height = 15;\r\n//-->\r\n</script>\r\n<script type=\"text/javascript\"\r\nsrc=\"http://pagead2.googlesyndication.com/pagead/show_ads.js\">\r\n</script></td></tr>\r\n    </tbody>\r\n</table>'),
(8, 'Welcome To Members', '<p>Post as many properties as you would like. It\'s <strong>FREE</strong> for our Registered Members</p>\r\n<p><strong>NOTE:</strong> You are looking for Investors that will invest in this property with you or are purchasing this property. Therefore, be precise, detailed, and provide as much information as possible. The Financial Investors are looking for thorough research and financial figures to make sure it is profitable for them.</p>\r\n<p>We have many members in Virginia, California, Tennessee, and Georgia looking for Properties to Invest In. If you have any Investment Properties to Wholesale or are looking for Private Funding, please post them for everyone to see.</p>\r\n<p>We are sending out Emails with new Property Postings on a bi-weekly basis. Please sign up to receive those emails by Editing your Account. </p>');
