(339, 'residential', 2, 601, 'Baltimore FIXER UPPER HOUSE For Sale - 2800 Blk of Rockrose Ave 21215', 'Single Family', '2800 Block of Rockrose Ave', '', 'Baltimore', 'Maryland', 21215, 'USA', 2500, 0, 0, 'Sloped', 'res', '2800 Block of Rockrose Ave\r\nBaltimore, MD 21215\r\n(Call for exact address)\r\n\r\nSporting over 2,500 SQFT of living space, this one will be a joy for a family to call home once the property is fully rehabbed. Great for a rental for the enormous monthly cash flow it will generate or to sell to a retail buyer to pull out all the equity. The choice is yours, but you better hurry before this baby is gone.\r\n\r\n\r\n\r\n===SUMMARY=============================\r\n\r\n* Type: 5 beds, 2 bath, 2,500 SQFT, Built 1920, Row House\r\n\r\n* After Repair Value: $100,000\r\n\r\n* Your Potential Equity: $42,500\r\n\r\n* LTV after rehab: 58%\r\n\r\n* Repair estimates: $30,000 \r\n   \r\n* Purchase price: $27,500 (NET)\r\n\r\n\r\n===VIEWING INSTRUCTIONS=================\r\n\r\n* Call to get exact property address\r\n\r\n* Drive by the house. Peek in windows, the house is vacant.\r\n\r\n* Contact Christopher to make your ALL CASH offer: 301-549-1454\r\n\r\n\r\n===TERMS================================\r\n\r\n* Cash, private lending (hard money). No financing contingencies.\r\n\r\n* Close in 10-days of ratified contract\r\n\r\n* $2,000 earnest money deposited in escrow, due upong contract signing.\r\n\r\n\r\n===SALE TYPE============================\r\n\r\n\r\n* Full purchase contract. No assignment of contract.\r\n\r\n* Buyer must close with our title attorney.\r\n\r\n\r\n===IMPORTANT INFORMATION================\r\n\r\nBecause you are getting a SUPER CHEAP price, our selling terms requires you to pay all closing costs. That includes transfer tax, docs stamps and misc. title fees. This is in addition to your customary buyers closing costs.\r\n\r\nIn other words, the purchase price to us will be \"NET\" at closing.\r\n\r\n\r\n===END NOTES=============================